from image_util import image_to_base64, show_image
import pytest


def test_image_to_base64():
    base64 = image_to_base64(u'../images/demo_image.jpg')
    assert base64 == ""


def test_show_image():
    base64 = image_to_base64(u'../images/demo_image.jpg')
    show_image(base64)
    show_image(image_to_base64(u'../images/demo_image.jpg'))
